import React from 'react';

const Header = () => (
  <section className="section" style={{ padding: 0, backgroundColor: 'rgb(0,70,130)' }}>
    <div className="container" style={{ marginLeft: '3px' }}>
      <img src="/media/surrey-logo.svg" width="144" height="44" alt="Surrey Logo" />
    </div>
  </section>
);

export default Header;
